INSERT INTO `licence_versions` (`id`, `terms`, `created_at`, `updated_at`) VALUES
(1, '<p><strong>Conditions et modalit&eacute;s d&rsquo;utilisation des photographies de la collection</strong></p>\r\n<p>En signant la licence et en payant les frais aff&eacute;rents, vous acceptez les conditions d''utilisation suivante :</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Conditions d''utilisation des fichiers d''images *</strong></p>\r\n<ol>\r\n<li><strong> L''autorisation de publication est accord&eacute;e d&egrave;s que vous recevez la copie de la pr&eacute;sente entente qui a &eacute;t&eacute; envoy&eacute;e par un repr&eacute;sentant autoris&eacute; de La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke. </strong></li>\r\n</ol>\r\n<p>L''autorisation de publication est accord&eacute;e uniquement aux fins d&eacute;crites dans cette entente. Cette autorisation est non exclusive. La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke se r&eacute;serve le droit de reproduire l''image et de permettre &agrave; des tiers de reproduire l''image.</p>\r\n<p>L''autorisation n''est plus valable d&egrave;s la publication ou la cr&eacute;ation du produit.</p>\r\n<p>Aux fins de cette entente, est consid&eacute;r&eacute;e comme une utilisation unique la publication simultan&eacute;e d''un produit dans plusieurs m&eacute;dias, par exemple un magazine produit sur papier et en version &eacute;lectronique.</p>\r\n<p>L''auteur de la demande est autoris&eacute; &agrave; utiliser l''image sur l''emballage du produit, dans une annonce, un catalogue ou un autre v&eacute;hicule promotionnel uniquement &agrave; des fins de commercialisation et de distribution du produit.</p>\r\n<p><strong>Toute utilisation subs&eacute;quente (y compris les futures &eacute;ditions et adaptations, produits connexes, versions Web, etc.) constitue une r&eacute;utilisation et doit faire l''objet d''une demande s&eacute;par&eacute;e &agrave; La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke. Des frais d''utilisation seront de nouveau applicables.</strong></p>\r\n<ol start="2">\r\n<li><strong> L''auteur de la demande assume l''enti&egrave;re responsabilit&eacute; de l''utilisation faite des images de La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke, conform&eacute;ment &agrave; la Loi sur le droit d''auteur.</strong></li>\r\n</ol>\r\n<p>La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke se r&eacute;serve le droit d''exiger une d&eacute;charge de la part des personnes dont le droit &agrave; la vie priv&eacute;e pourrait &ecirc;tre l&eacute;s&eacute; par la production d''une image. Il est interdit d''utiliser l''image d''une personne identifiable d''une mani&egrave;re qui sugg&egrave;re un appui ou une association avec un produit, un service, une cause ou un &eacute;tablissement.</p>\r\n<p>L''auteur de la demande exon&egrave;re La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke et ses repr&eacute;sentants de toute responsabilit&eacute; quant aux r&eacute;clamations pouvant r&eacute;sulter de l''utilisation du mat&eacute;riel et s''engage &agrave; indemniser La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke et ses repr&eacute;sentants de tous les co&ucirc;ts et dommages-int&eacute;r&ecirc;ts r&eacute;sultant d''une utilisation non autoris&eacute;e du mat&eacute;riel.</p>\r\n<p>&nbsp;</p>\r\n<ol start="3">\r\n<li><strong> En cas d''utilisation d''image, on doit indiquer le nom du Fonds et le nom de La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke</strong> <strong>sous forme de l&eacute;gende, sauf dans les films, o&ugrave; l''on doit inclure le nom de La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke</strong> <strong>dans le g&eacute;n&eacute;rique sans n&eacute;cessairement pr&eacute;ciser le nom du Fonds.</strong></li>\r\n</ol>\r\n<p>La l&eacute;gende doit appara&icirc;tre pr&egrave;s de l''image ou dans une section sp&eacute;ciale consacr&eacute;e aux mentions de source. Dans les reproductions distribu&eacute;es par voie &eacute;lectronique, cependant, la mention de source doit &ecirc;tre int&eacute;gr&eacute;e &agrave; l''image.</p>\r\n<p>Le paiement de frais d''utilisation commerciale ne dispense pas l''utilisateur de mentionner le nom de La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke.</p>\r\n<p>&nbsp;</p>\r\n<ol start="4">\r\n<li><strong> Les images fournies par La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke</strong> <strong>ne peuvent &ecirc;tre copi&eacute;es, num&eacute;ris&eacute;es, pr&eacute;sent&eacute;es, vendues ni utilis&eacute;es &agrave; d''autres fins que celles pr&eacute;cis&eacute;es dans cette entente. Aucune copie ne peut &ecirc;tre d&eacute;pos&eacute;e dans un autre service d''archive ou biblioth&egrave;que.</strong></li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol start="5">\r\n<li><strong> &Agrave; moins d''autorisation pr&eacute;alable de La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke, il est interdit de retoucher ou de modifier les images d''une fa&ccedil;on qui risque de nuire &agrave; leur int&eacute;grit&eacute; historique ou artistique. S''il est n&eacute;cessaire de reproduire un d&eacute;tail d''une image, il faut indiquer le mot &laquo; d&eacute;tail &raquo; entre parenth&egrave;ses &agrave; c&ocirc;t&eacute; du nom du Fonds de provenance de l&rsquo;image.</strong></li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol start="6">\r\n<li><strong> L''autorisation n''est accord&eacute;e qu''apr&egrave;s le paiement pr&eacute;alable de tous les frais, y compris les frais d''utilisation.</strong></li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol start="7">\r\n<li><strong> Seule la reproduction de fichiers num&eacute;riques fournis par La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke</strong> <strong>est autoris&eacute;e.</strong></li>\r\n</ol>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol start="8">\r\n<li><strong> Les renseignements personnels recueillis dans le cadre de cette entente par La Soci&eacute;t&eacute; d&rsquo;histoire de Sherbrooke</strong> <strong>ne seront pas utilis&eacute;s &agrave; d''autres fins.</strong></li>\r\n</ol>\r\n<p>* Ce texte est reproduit avec la permission du Mus&eacute;e McCord, <span style="text-decoration: underline;">http://www.musee-mccord.qc.ca/</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;La Soci&eacute;t&eacute; d''histoire de Sherbrooke</p>', '2016-12-21 18:05:00', '2016-12-21 18:05:00');
